INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Multiple-choice', 'Multiple_Choice', 'A forced-choice assessment item featuring a stem (which is a prompt) and two or more choices, one of which is the correct answer, and the remainder are distractors.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Fill-in-the-blank', 'Fill_In_The_Blank', 'A short-answer item in which examinees are presented with a sentence in which a word or words is missing, and are asked to provide the missing word(s).', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'True/False', 'True_False', 'A declarative statement that examinees judge true or false.  Variants of the true/false item have examinees identify: fact/opinion, supported by the narrative or not, etc.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Multiple Response', 'Multiple_Response', 'A multiple choice assessment item that directs examinees to select all of the options that apply.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Matching', 'Matching', 'An assessment item in which examinees are presented with a set of premises and are asked to link them to a set of responses, via directions for identifying the correspondences.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Short answer', 'Short_Answer', 'An assessment item that asks examinees to provide a very short response, such as an item asking for a correct computational or text-based answer, or a closed item.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Labeling', 'Labeling', 'An assessment item that presents an image or object, such as a graph, diagram, or geometric shape, and asks examinees to apply one or more descriptive, symbolic, or quantitative labels.', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Visual representation', 'Visual_Representation', 'An assessment item that asks examinees to create simple graphics (e.g., sketches, schematics, diagrams) to generate evidence of understanding a key concept or its application.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Show your work', 'Show_Your_Work', 'An assessment item that asks examinees to show preparatory work for the creation of a product, performance, or extended text.   The item may be treated as one component of a task leading to a final product or may be stand-alone, as evidence of preliminary thinking and problem-solving.', null, 9.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Other constructed response', 'Other_Constructed_Response', 'Any assessment item that asks the examinee to develop answers without suggested answer choices and that does not fit the definition of the other assessment item types.', null, 10.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Performance task', 'Performance_Task', 'An item or set of items that directs examinees to demonstrate what they know and can do via a performance, given a set of conditions and expectations for the task(s).  The range of possible performances is long, and may include oral, written, procedural, artistic, and/or psychomotor performances such as conducting science experiments, developing informational materials, or participating in a recital, to name a few.  An extended constructed response or essay item is a specific instance of a performance task.', null, 11.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Extended Response (Essay)', 'Extended_Response', 'An assessment item type that asks examinees to prepare and deliver an organized, cohesive response to an item prompt.  The essay item is one type of extended constructed response.  Others include the development and sequencing of mathematical proofs, extended analytical papers, and research papers.', null, 12.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Technology Enhanced / Interactive', 'Technology_Enhanced_Interactive', 'An  interactive assessment item delivered in an online or computerized testing environment such that the manipulation of the stem, options, or other facet of the item by the examinees becomes part of the item prompt or part of the item response.  Scalise and Gifford (2006**) present a taxonomy of 28 innovative item types that include: Drag and Drop, Reordering, and other experiential items.', null, 13.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Reordering', 'Reordering', 'An assessment item that asks examinees to reorder items, such as pictures of events within a chronological sequence, items forming a pattern, or text within a passage.', null, 14.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Substitution', 'Substitution', 'An assessment item that presents visual or written stimulus with incomplete or incorrect information and asks examinees to correct or complete the information.', null, 15.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Assessment_Item_Type( Ref_Assessment_Item_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Other', 'Other', 'Other assessment item type.', null, 16.00 ); 
