INSERT INTO ceds6sc_rdx.Ref_Assessment_Need_Braille_Grade_Type( Ref_Assessment_Need_Braille_Grade_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Uncontracted', 'Uncontracted', 'Uncontracted is defined as part of an Assessment Personal Needs Profile to be the grade of Braille to use when using a Braille display.', null, 2.00 ); 
