INSERT INTO ceds6sc_rdx.Ref_Attendance_Status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Present', 'Present', 'Present is specified as the status of a person''s attendance associated with an Attendance Event Type, Calendar Event Date, in an organization-person-role context.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Attendance_Status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Excused Absence', 'Excused_Absence', 'Not present but is temporarily excused from attendance because the person is: 1) is ill and attendance would endanger his or her health or the health of others; 2) has an immediate family member who is seriously ill or has died; 3) is observing a recognized religious holiday of his or her faith; or 4) is otherwise excused in accordance with policies.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Attendance_Status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Unexcused Absence', 'Unexcused_Absence', 'Not present without acceptable cause or authorization.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Attendance_Status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Tardy', 'Tardy', 'Is absent at the time a given schedule when attendance begins but is present before the close of that time period.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Attendance_Status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Early Departure', 'Early_Departure', 'Leaves before the official close of the daily session. Reasons may include a special activity for curricular enrichment, doctor''s appointment, and family emergency. State, local, and school regulations may distinguish excused and unexcused early departures. When officially approved on a regular basis, early departures immediately prior to the close of the session are considered to be released time.', null, 10.00 ); 
