INSERT INTO ceds6sc_rdx.Ref_Entry_Type( Ref_Entry_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Original entry into a United States school from a foreign country with no interruption in schooling', '01839', 'Original entry into a United States school from a foreign country with no interruption in schooling is the process by which the student entered a school during a given academic session.', null, 18.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Entry_Type( Ref_Entry_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Original entry into a United States school from a foreign country with an interruption in schooling', '01840', 'Original entry into a United States school from a foreign country with an interruption in schooling is the process by which the student entered a school during a given academic session.', null, 19.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Entry_Type( Ref_Entry_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'Other', '09999', 'The process by which the student entered a school during a given academic session is in a category not yet defined in CEDS.', null, 20.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Exit_Or_Withdrawal_Status( Ref_Exit_Or_Withdrawal_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Permanent', 'Permanent', 'The instance of student exit/withdrawal is considered to be of a permanent nature.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Exit_Or_Withdrawal_Status( Ref_Exit_Or_Withdrawal_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Temporary', 'Temporary', 'The instance of student exit/withdrawal is considered to be of a temporary nature.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Wages', 'Wages', 'Wages is a source of total family income.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Alimony', 'Alimony', 'Alimony is a source of total family income.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Child support', 'Child_Support', 'Child support is a source of total family income.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Worker''s compensation', 'Workers_Comp', 'Worker''s compensation is a source of total family income.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Unemployment', 'Unemployment', 'Unemployment is a source of total family income.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Supplemental security income', 'SSI', 'Supplemental security income is a source of total family income.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Temporary assistance for needy families', 'TANF', 'Temporary assistance for needy families is a source of total family income.', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Agricultural', 'Agricultural', 'Agricultural is a source of total family income.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Family_Income_Source( Ref_Family_Income_Source_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Other', 'Other', 'A source of total family income in a category not yet defined in CEDS.', null, 9.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Cash in Bank', '101', 'All funds on deposit with a bank or savings and loan institution, normally in non-interest-bearing accounts. Interest-bearing accounts, however, that do not meet the definition of an investment (e.g., demand deposits that are interest-bearing) should be recorded herein as well.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Cash on Hand', '102', 'Currency, coins, checks, postal and express money orders, and bankers'' drafts on hand.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Petty Cash', '103', 'A sum of money set aside to pay small obligations for which the issuance of a formal voucher and check would be too expensive and time consuming.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Change Cash', '104', 'A sum of money set aside to provide change.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Cash With Fiscal Agents', '105', 'Deposits with fiscal agents, such as commercial banks, for paying matured bonds and interest.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Investments', '111', 'Securities and real estate held for producing income in the form of interest, dividends, rentals, or lease payments. Investments should be presented at fair value as of the reporting date. Gains from changes in the fair value of investments are recorded using revenue account 1530. Losses from changes in the fair value of investments are recorded using expenditure object code 930. Alternatively, gains and losses may be netted and recorded in revenue account 1530. The account does not include capital assets used in school district operations. Separate accounts may be maintained for each category of investments.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Unamortized Premiums on Investments', '112', 'The excess of the amount paid for securities over the face value that has not yet been amortized. Use of this account is restricted to short- term money market investments.', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Unamortized Discounts on Investments (Credit)', '113', 'The excess of the face value of securities over the amount paid for them that has not yet been written off. Use of this account is restricted to short-term investments.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Interest Receivable on Investments', '114', 'The amount of interest receivable on investments, excluding interest purchased. Interest purchased should be shown in a separate account.', null, 9.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Accrued Interest on Investments Purchased', '115', 'Interest accrued on investments between the last interest payment date and the date of purchase. The account is carried as an asset until the first interest payment date after the date of purchase.', null, 10.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Taxes Receivable', '121', 'The uncollected portion of taxes that a school district or government unit has levied and that has become due, including any interest or penalties that may be accrued. Separate accounts may be maintained on the basis of tax roll year, current and delinquent taxes, or both.', null, 11.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Allowance for Uncollectible Taxes (Credit)', '122', 'The portion of taxes receivable estimated not to be collected. The account is shown on the balance sheet as a deduction from the taxes receivable account to arrive at the net taxes receivable. Separate accounts may be maintained on the basis of tax roll year, delinquent taxes, or both.', null, 12.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Interfund Loans Receivable', '131', 'An asset account used to record a loan by one fund to another fund in the same governmental unit. It is recommended that separate accounts be maintained for each interfund receivable loan.', null, 13.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Interfund Accounts Receivable', '132', 'An asset account used to indicate amounts owed to a particular fund by another fund in the same school district for goods sold or services rendered. It is recommended that separate accounts be maintained for each interfund receivable.', null, 14.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Intergovernmental Accounts Receivable', '141', 'Amounts due to the reporting governmental unit from another governmental unit. These amounts may represent grants-in-aid, shared taxes, taxes collected for the reporting unit by another unit, loans, and charges for services rendered by the reporting unit for another government. It is recommended that separate accounts be maintained for each interagency receivable.', null, 15.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Loans Receivable', '151', 'Amounts that have been loaned to persons or organizations, including notes taken as security for such loans, where permitted by statutory authority.', null, 16.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Allowance for Uncollectible Loans (Credit)', '152', 'The portion of loans receivable estimated not to be collected. The account is shown on the balance sheet as a deduction from the other loans receivable account.', null, 17.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Other Accounts Receivable', '153', 'Amounts due on open account from private persons, firms, or corporations for goods and services furnished by a school district (but not including amounts due from other funds or from other governmental units).', null, 18.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Allowance for Uncollectible Accounts Receivable (Credit)', '154', 'A provision for that portion of accounts receivable that is estimated will not be collected. The account is shown on the balance sheet as a deduction from the other accounts receivable account.', null, 19.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'Inventories for Consumption', '171', 'The cost of supplies and equipment on hand not yet distributed to requisitioning units.', null, 20.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'Inventories for Resale', '172', 'The value of goods purchased and held by a school district for resale rather than for use in its own operations. Such goods could include unique manufactured inventories, such as student-built homes or equipment.', null, 21.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 22, 'Prepaid Items', '181', 'Expenditures/expenses paid for benefits not yet received. Prepaid expenses differ from deferred charges in that they are spread over a shorter period of time and are regularly recurring costs of operation. Examples of prepaid expenses are prepaid rent, prepaid interest, and unexpired insurance premiums.', null, 22.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 23, 'Deposits', '191', 'Funds deposited by the school district as a prerequisite to receiving services, goods, or both.', null, 23.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 24, 'Bond Insurance Costs', '193', 'Bond insurance costs that are a form of prepayment to be amortized.', null, 24.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 25, 'Premium and Discount on Issuance of Bonds', '194', 'Represents amounts to be amortized as debt premium/discount in connection with the issuance of bonds.', null, 25.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 26, 'Other Current Assets', '199', 'Current assets not provided for elsewhere.', null, 26.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 27, 'Capital Assets', '200', 'Those assets that the school district intends to hold or continue to use over a long period of time. Specifically, capital assets include land, improvements to land, easements, buildings and building improvements, vehicles, machinery, equipment, works of art and historical treasures, infrastructure, and all other tangible or intangible assets that are used in operations and that have initial useful lives that extend beyond a single reporting period. This account is used only in proprietary funds, fiduciary funds, and the government-wide financial statements.', null, 27.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 28, 'Land and Land Improvements', '211', 'A capital asset account that reflects the acquisition value of land owned by a school district. If land is purchased, this account includes the purchase price and costs such as legal fees, filling and excavation costs, and other associated improvement costs incurred to put the land in condition for its intended use. If land is acquired by gift, the account reflects its fair value at the time of acquisition. Permanent improvements to land, such as grading and fill, should also be accounted for in this account. Land and land improvements are considered nonexhaustible assets owing to their significantly long expected useful life. Nonexhaustible assets are not to be depreciated. Therefore, assets classified by asset code 211 should result in no depreciation expense.', null, 28.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 29, 'Site Improvements', '221', 'A capital asset account that reflects the value of nonpermanent improvements to building sites, other than buildings, that add value to land. Examples of such improvements are fences, retaining walls, sidewalks, pavements, gutters, tunnels, and bridges. If the improvements are purchased or constructed, this account contains the purchase or contract price. If improvements are obtained by gift, it reflects the fair value at the time of acquisition. Site improvements are improvements that have a limited useful life. Because these improvements decrease in their value/usefulness over time, it is appropriate to depreciate these assets. Therefore, all capitalized site improvements should be depreciated over their expected useful life.', null, 29.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 30, 'Accumulated Depreciation on Site Improvements', '222', 'Accumulated amounts for the depreciation of land improvements.', null, 30.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 31, 'Buildings and Building Improvements', '231', 'A capital asset account that reflects the acquisition value of permanent structures used to house persons and property owned by the school district. If buildings are purchased or constructed, this account includes the purchase or contract price of all permanent buildings and the fixtures attached to and forming a permanent part of such buildings. This account includes all building improvements, including upgrades made to building wiring for technology. If buildings are acquired by gift, the account reflects their fair value at the time of acquisition.', null, 31.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 32, 'Accumulated Depreciation on Buildings and Building Improvements', '232', 'Accumulated amounts for the depreciation of buildings and building improvements.', null, 32.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 33, 'Machinery and Equipment', '241', 'Tangible property of a more or less permanent nature, other than land, buildings, or improvements thereto, that is useful in carrying on operations. Examples are machinery, tools, trucks, cars, buses, computers, purchased software, furniture, and furnishings. Appendix E provides criteria to distinguish whether a purchase is a supply or a piece of machinery or equipment.', null, 33.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 34, 'Accumulated Depreciation on Machinery and Equipment', '242', 'Accumulated amounts for the depreciation of machinery and equipment.', null, 34.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 35, 'Works of Art and Historical Treasures', '251', 'Individual items or collections of items that are of artistic or cultural importance.', null, 35.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 36, 'Accumulated Depreciation on Works of Art and Historical Collections', '252', 'Accumulated amounts for the depreciation (as applicable) of works of art and historical treasures.', null, 36.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 37, 'Infrastructure', '261', 'A capital asset, network, or subsystem that has a useful life that is significantly longer than those of other capital assets. These assets may include water/sewer systems, roads, bridges, tunnels, and other similar assets.', null, 37.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 38, 'Accumulated Depreciation on Infrastructure', '262', 'Accumulated amounts for the depreciation of infrastructure assets.', null, 38.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 39, 'Construction in Progress', '271', 'The cost of construction work undertaken but not yet completed.', null, 39.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 40, 'Intangible Assets', '281', 'An intangible asset is a capital asset that lacks physical substance, is nonfinancial in nature, and has an initial useful life of more than 1 year. Intangible assets may be purchased or licensed, acquired through nonexchange transactions, or internally generated. Examples include easements, contractual rights, patents, trademarks, and computer software.', null, 40.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 41, 'Accumulated Amortization of Intangible Assets', '282', 'Accumulated amounts for the amortization of intangible assets.', null, 41.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 42, 'Deferred Outflows of Resources', '300', 'A consumption of net assets by the government that is applicable to a future reporting period.', null, 42.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 43, 'Interfund Loans Payable', '401', 'A liability account used to record a debt owed by one fund to another fund in the same governmental unit. It is recommended that separate accounts be maintained for each interfund loan.', null, 43.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 44, 'Interfund Accounts Payable', '402', 'A liability account used to indicate amounts owed by a particular fund for services rendered. It is recommended that separate accounts be maintained for each interfund payable.', null, 44.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 45, 'Intergovernmental Accounts Payable', '411', 'Amounts owed by the reporting school district to another governmental unit. It is recommended that separate accounts be maintained for each intergovernmental payable.', null, 45.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 46, 'Accounts Payable', '421', 'Liabilities on open account owed to private persons, firms, or corporations for goods and services received by a school district (but not including amounts due to other funds of the same school district or to other governmental units).', null, 46.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 47, 'Judgments Payable', '422', 'Amounts due to be paid by a school district as the result of court decisions, including condemnation awards paid for private property taken for public use.', null, 47.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 48, 'Warrants Payable', '423', 'Amounts due to designated payees in the form of a written order drawn by the school district directing the school district treasurer to pay a specific amount.', null, 48.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 49, 'Contracts Payable', '431', 'Amounts due on contracts for assets, goods, and services received by a school district.', null, 49.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 50, 'Construction Contracts Payable-Retainage', '432', 'Liabilities on account of construction contracts for that portion of the work that has been completed but on which part the liability has not been paid pending final inspection, the lapse of a specified time period, or both. The unpaid amount is usually a stated percentage of the contract price.', null, 50.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 51, 'Construction Contracts Payable', '433', 'Amounts due by a school district on contracts for constructing buildings and other structures and other improvements.', null, 51.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 52, 'Matured Bonds Payable', '441', 'Bonds that have reached or passed their maturity date but that remain unpaid.', null, 52.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 53, 'Bonds Payable-Current', '442', 'Bonds that have not reached or passed their maturity date but are due within 1 year or less. This account is used only in proprietary or fiduciary funds, as well as in the government-wide financial statements.', null, 53.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 54, 'Unamortized Premiums on Issuance of Bonds', '443', 'An account that represents that portion of the excess of bond proceeds over par value and that remains to be amortized over the remaining life of such bonds. This account is used only in proprietary or fiduciary funds, as well as in the government-wide financial statements.', null, 54.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 55, 'Loans Payable', '451', 'Short-term obligations representing amounts borrowed for short periods of time, usually evidenced by notes payable or warrants payable.', null, 55.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 56, 'Lease Obligations-Current', '452', 'Capital lease obligations that are due within 1 year.', null, 56.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 57, 'Interest Payable', '455', 'Interest due within 1 year.', null, 57.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 58, 'Accrued Salaries and Benefits', '461', 'Salary and fringe benefit costs incurred during the current accounting period that are not payable until a subsequent accounting period.', null, 58.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 59, 'Payroll Deductions and Withholdings', '471', 'Amounts deducted from employees'' salaries for withholding taxes and other purposes. District-paid benefits amounts payable are also included. A separate liability account may be used for each type of benefit.', null, 59.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 60, 'Compensated Absences-Current', '472', 'Compensated absences that will be paid within 1 year.', null, 60.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 61, 'Accrued Annual Requirement Contribution Liability', '473', 'A liability arising from payments not made to pension funds. This amount represents any difference between the actuarially determined annual required contribution and actual payments made to the pension fund.', null, 61.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 62, 'Advances from Grantors', '481', 'A liability account that represents resources received from grantors before eligibility requirements are met.', null, 62.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 63, 'Deposits Payable', '491', 'Liability for deposits received as a prerequisite to providing or receiving services, goods, or both.', null, 63.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 64, 'Other Current Liabilities', '499', 'Other current liabilities not provided for elsewhere.', null, 64.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 65, 'Long-Term Liabilities', '500', 'Obligations with a maturity of more than 1 year. These accounts should be used only with proprietary and fiduciary funds, as well as at the entity-wide level of reporting.', null, 65.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 66, 'Bonds Payable', '511', 'Bonds (general obligation, asset-backed, or revenue-backed) that have not reached or passed their maturity date and that are not due within 1 year.', null, 66.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 67, 'Accreted Interest', '512', 'An account that represents interest that is accrued on deep discount bonds. This account should be used by school districts that issue capital appreciation bonds. Such bonds are usually issued at a deep discount from the face value, and no interest payment is made until maturity. Under full accrual accounting, the district is required to accrete the interest on the bonds over the life of the bonds. Accretion is the process of systematically increasing the carrying amount of the bond to its estimated value at the maturity date of the bond. To calculate accreted interest, the district should impute the effective interest rate, using the present value, the face value (or the future value), and the period of the bond, and multiply the effective interest rate by the book value of the debt at the end of the period. Accreted interest is usually recorded as an addition to the outstanding debt liability.', null, 67.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 68, 'Unamortized Gains/Losses on Debt Refundings', '513', 'An account that represents the difference between the reacquisition price and the net carrying amount of old debt when a current or advance refunding of debt occurs. This account should be used only when defeasance of debt occurs for proprietary funds and entity-wide statements. The unamortized loss amount should be reported as a deferred outflow of resources and amortized as a component of interest expense in a systematic and rational manner over the remaining life of the old debt or the life of the new debt, whichever is shorter. The unamortized gain amount should be reported as a deferred inflow of resources and amortized as a component of interest expense in a systematic and rational manner over the remaining life of the old debt or the life of the new debt, whichever is shorter.', null, 68.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 69, 'Loans Payable', '521', 'An unconditional written promise signed by the maker to pay a certain sum of money 1 year or more after the issuance date.', null, 69.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 70, 'Capital Lease Obligations', '531', 'Amounts remaining to be paid on capital lease agreements.', null, 70.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 71, 'Compensated Absences', '551', 'Amounts remaining beyond the period of 1 year to be paid on compensated absences balances.', null, 71.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 72, 'Special Termination Benefits', '553', 'These are benefits offered for a short period of time to employees in connection with their termination of employment. Special termination benefits are often used as an inducement for early retirement or to address budgetary problems.', null, 72.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 73, 'Arbitrage Rebate Liability', '561', 'Liabilities arising from arbitrage rebates to the Internal Revenue Service (IRS) from bond financing.', null, 73.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 74, 'Other Long-Term Liabilities', '590', 'Other long-term liabilities not provided for elsewhere. This account represents amounts due after more than 1 year from the balance sheet date for advances from other funds and certain miscellaneous liabilities, including workers'' compensation, self-funded insurance, special termination benefits, and legal claims and judgments.', null, 74.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 75, 'Deferred Inflows of Resources', '600', 'An acquisition of net assets by the government that is applicable to a future reporting period. A deferred inflow of resources should be recognized when resources are received or recognized as a receivable before (a) the period for which property taxes are levied or (b) the period when the resources are required to be used. When an asset is recorded in governmental fund financial statements but the revenue is not available, the government should report a deferred inflow of resources until such time as the revenue becomes available.', null, 75.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 76, 'Nonspendable Fund Balance', '710', 'The nonspendable fund balance classification includes amounts that cannot be spent because they are either (a) not in spendable form or (b) legally or contractually required to be maintained intact. This would include items not expected to be converted to cash, including inventories and prepaid amounts. It may also include the long-term amount of loans and receivables, as well as property acquired for resale and the corpus (principal) of a permanent fund.', null, 76.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 77, 'Restricted Fund Balance', '720', 'The restricted fund balance classification should be reported when legally enforceable constraints placed on the use of resources are either (a) externally imposed by creditors, grantors, contributors, or laws or regulations of other governments or (b) imposed by law through constitutional provisions or enabling legislation.', null, 77.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 78, 'Committed Fund Balance', '730', 'The committed fund balance classification reflects specific purposes pursuant to constraints imposed by formal action at the district''s highest level of decisionmaking authority (generally the governing board). Such constraints can only be removed or changed by the same form of formal action.', null, 78.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 79, 'Assigned Fund Balance', '740', 'The assigned fund balance classification reflects amounts that are constrained by the government''s intent to be used for specific purposes, but meet neither the restricted nor committed forms of constraint. Also, the assigned fund balance classification is the residual classification for the special revenue, debt service, capital projects, and/or permanent funds after nonspendable, restricted, and committed balances have been identified (unless the residual amount is negative, which would require presentation as unassigned fund balance).', null, 79.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 80, 'Unassigned Fund Balance', '750', 'The unassigned fund balance classification is the residual classification, for the general fund only, after nonspendable, restricted, committed, and assigned balances have been identified. It is also used to report the residual amount for all other governmental funds after nonspendable, restricted, and committed balances have been identified, if the residual amount is negative.', null, 80.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 81, 'Net Investment in Capital Assets', '760', 'This account is used to record the component of net position invested in capital assets, net of related debt, that represents total capital assets less accumulated depreciation less debt directly related to capital assets. This account is to be used only in proprietary funds and entity-wide statements. (This was previously fund balance code 740.)', null, 81.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 82, 'Restricted Net Position', '770', 'This account is used to record the component of net position that represents net assets legally restricted by sources internal or external to the organization. This account is to be used only in proprietary funds and entity-wide statements. (This was previously fund balance code 750.)', null, 82.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Account_Balance_Sheet_Code( Ref_Financial_Balance_Sheet_Account_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 83, 'Unrestricted Net Position', '780', 'This account is used to record the component of net position that represents net position not classified in accounts 760 and 770. This account is to be used only in proprietary funds and entity-wide statements. (This was previously fund balance code 760.)', null, 83.00 ); 
